import{_ as r,c as t,o as a,d as n}from"./app.c522a08b.js";const c=JSON.parse('{"title":"DT hj\xE4rna","description":"","frontmatter":{},"headers":[{"level":2,"title":"Fr\xE5gest\xE4llningar","slug":"fragestallningar"}],"relativePath":"dt-hjarna.md","lastUpdated":1668539668000}'),e={name:"dt-hjarna.md"},i=n('<h1 id="dt-hjarna" tabindex="-1">DT hj\xE4rna <a class="header-anchor" href="#dt-hjarna" aria-hidden="true">#</a></h1><p>DT hj\xE4rna \xE4r en nativ unders\xF6kning utan kontrast. Vanliga fr\xE5gest\xE4llningar \xE4r bl\xF6dning, infarkt, expansivitet, skelettskada och hydrocefalus.</p><div class="tip custom-block"><p class="custom-block-title">Normalfynd</p><p>Ex. Ingen bl\xF6dning, avgr\xE4nsbar infarkt, fraktur i neurokraniet eller expansivitet. Normalvida likvorrum. Op\xE5verkade basala cisterner. Luftf\xF6rande sinus och mastoidceller.</p></div><div class="warning custom-block"><p class="custom-block-title">Indikation</p><p>Exempel:</p><ul><li>Skalltrauma (kombinera \xE4ven med DT halsrygg)</li><li>Stroke</li><li>Oklar medvetandep\xE5verkan.</li></ul></div><h2 id="fragestallningar" tabindex="-1">Fr\xE5gest\xE4llningar <a class="header-anchor" href="#fragestallningar" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">Exempel</p><ol><li>Bl\xF6dning?</li><li>Infarkt?</li><li>Skelettskada?</li><li>Expansivitet?</li><li>Hydrocefalus?</li></ol></div><br><div class="hjarna"><table><thead><tr><th>Fr\xE5gest\xE4llning</th><th>Tillst\xE5nd</th><th>Kommentar</th></tr></thead><tbody><tr><td><b>Bl\xF6dning?</b></td><td><u>Intrakraniell bl\xF6dning</u><br>1. Hemorragisk stroke<br>2. Traumatisk bl\xF6dning</td><td><u>Subaraknoidalbl\xF6dning:</u><br>- DT-hj\xE4rna om symtomdebut &lt;6h, annars os\xE4ker metod.<br>- DT-angiografi vid spontan subaraknoidalbl\xF6dning. Ingen angio vid tydligt traumatisk subaraknoidalbl\xF6dning.<br>- LP + spektrofotometri vid symtomdebut &gt;12h sedan.</td></tr><tr><td><b>Infarkt? /<br>Demarkerad infarkt?</b></td><td><u>Ischemisk stroke</u><br>1. F\xE4rsk infarkt<br>2. Gammal infarkt</td><td><u>Fynd:</u><br>- Demarkerad infarkt: synlig infarkt.<br>- L\xE5gattenuarande kortex: oftast infarktsmisstanke, alternativt tum\xF6rmisstanke.<br>- Dense vessel sign: hyperdens blodk\xE4rl som vid aktuell ocklusion (tromb eller emboli).<br>- Lakun\xE4r infark: liten (&lt;15 mm) infarkt som inte engagerar kortex, ofta pga. mikroangiopati.<br>- Substansdefek: efter t.ex. genomg\xE5ngen infarkt, bl\xF6dning eller tidigare operation.</td></tr><tr><td><b>Skelettskada?</b></td><td>- Fraktur i neurokranium<br>- Skallbasfraktur<br>- N\xE4sfraktur<br>- Orbitafraktur<br>- Maxillarfraktur</td><td>OBS! Mandibeln ing\xE5r inte i unders\xF6kningen.</td></tr><tr><td><b>Expansivitet?</b></td><td>- Tum\xF6r (malign / benign)<br>- Hj\xE4rnabscess</td><td>F\xF6r n\xE4rmare diagnostik kr\xE4vs oftast DT hj\xE4rna med kontrast.<br><br><u>Fynd:</u><br>- Perifokalt \xF6dem<br>- Kompression av ventriklar: medellinjef\xF6rskjutning<br>- Masseffekt: trycker p\xE5 omgivande strukturer<br>- Herniering: inkl\xE4mning av strukturer</td></tr><tr><td><b>Hydrocefalus?</b></td><td>- Kommunicerande hydrocefalus<br>- Icke-kommunicerande hydrocefalus</td><td><u>Fynd:</u> Vida ventriklar med/utan komprimerade f\xE5ror.</td></tr><tr><td><b>Degenerativa f\xF6r\xE4ndringar?</b></td><td>Exempel:<br>- Demenssjukdomar<br>- Mikroangiopati</td><td><u>Fynd:</u><br>- Atrofi<br>- Degenerativa vitsubstansf\xF6r\xE4ndringar<br>- Vida ventriklar<br></td></tr><tr><td><b>F\xF6rlopps-DT?</b></td><td><u>Progress/regress av:</u><br>- Bl\xF6dning<br>- Infarkt</td><td>Vid bl\xF6dning kontakta neurokirurgen f\xF6r diskussion kring handl\xE4ggning och n\xE4r kontroll-DT ska g\xF6ras. H\xE5ll patienten fastande tills dess.</td></tr></tbody></table></div>',8),d=[i];function l(s,o,k,b,u,g){return a(),t("div",null,d)}const f=r(e,[["render",l]]);export{c as __pageData,f as default};
